import React,{useState} from 'react';
import {Modal,Button} from 'react-bootstrap'
import AddContact from './AddContact'
import ContactTable from './ContactTable';
import {AddContact as Add,UpdateContact} from '../redux/ContactActions'
import { connect } from 'react-redux';




const ContactsList = (props) => {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    const handleSubmit = (data) => {
        setShow(false)
        if(data.ID===""){
            ad
        }
    };


    return (
        <div className="container">
            <div className="row justify-content-center m-2">
                <h2>Contacts List</h2>
            </div> 
            <div className="d-flex justify-content-between m-2">
                <div className="d-flex flex-row col-sm-4">
                    <input type="text" 
                        className="form-control border border-secondary" 
                        placeholder="Search"
                    />
                    <button className="btn btn-primary ml-2">Search</button>
                </div>
                <button onClick={()=>{setShow(true)}} className="btn btn-primary">Add Contact</button>
            </div>
          
            <div className="col-sm-12">
                <ContactTable/>
            </div>
            
            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Add Contact</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <AddContact handleClose={handleClose} handleSubmit={handleSubmit}/>
                </Modal.Body>
            </Modal>     
        </div>
    );
};



const mapDispatchToProps=(dispatch)=>{
    return{
        handleSave:(data)=>{dispatch(Add(data))},
        handleUpdate:(data)=>{dispatch(UpdateContact(data))}
    }
}
export default connect(null,mapDispatchToProps)(ContactsList);
